import Link from 'next/link';
import {headerLogo} from '../imgs/img';

const Header = () => (
    <header>
        <div className="header">
            <img src={headerLogo} />
        </div>
        <Link href="/">
            <a>Home</a>
        </Link>
        <Link href="/about">
            <a>About</a>
        </Link>
        <style jsx>
            {`
                .header{
                    height:50px;
                    border:1px solid #000;
                }
                a{
                    color:#EF141F;
                    font-size:26px;
                    line-height:40px;
                    text-decoration:none;
                    padding:0 10px;
                    text-transform:uppercase;
                }
                a:hover{
                    opacity:0.8;
                }
            `}
        </style>
    </header>
)

export default Header;
